import HomeCarousel from '../../components/home-carousel/HomeCarousel'
import './Home.css'
import ConjuntoKarol from '../../assets/products/conjuntoKarol.png';
import ConjuntoPaula from '../../assets/products/conjuntoPaula.png';
import { Button } from '@mui/material';


export default function Home() {
 return (
    <>
  <HomeCarousel />
  <div className='container-main'>
    <h2 className='releases-products'>LANÇAMENTOS</h2>
    <div className='container-images'>

        <img className='colecaoQueen' src={ConjuntoKarol} alt='Conjunto Karol'/>
        <img className='colecaoQueen' src={ConjuntoPaula} alt='Conjunto Paula'/>


    </div>

    <>
        <Button className='releases-button' variant='outlined' style={{background:'#F579B8', color:'black', margin:'-150px 0 50px 0'}}>Clique e veja todos os Lançamentos</Button>
        </>

  </div>
  </>
 )
}
